description.para:
 The set of functions which return other track parameters. The remaining track parameters (i.e. not the 'defining parameters') use the 'curvilinear' coordinate system, and are represented by the parameters $(x,y,z,p_x,p_y,p_z)$. The parameters can have an associated local 5x5 error/covariance matrix. They are expressed at various points through the detector, which can be determined by the parameterPosition() method. //Examplecodetouseparameters
unsignedintindex=0;
if(myTP.indexOfParameterAtPosition(index,xAOD::FirstMeasurement)){
CurvilinearParameters_tparameters=myTP.trackParameters(index);
}

detaileddescription.para:
Access methods for track properties, which returns 'true' if a logical AND of the parameter 'proprty' and the stored properties returns true. i.e. you do: TrackPropertiestestProperty;
testProperty.set(SOMEPROPERTY);
if(trackParticle.trackProperties(testProperty))doSomething();
